import './App.css';
import Hello from './components/Hello';

const names = ["Dima", "Alex", "Victor"]

function App() {
  return (
    <div className="App">
      <Hello name={names[0]}/>
      <Hello name={names[1]}/>
      <Hello name={names[2]}/>
    </div>
  );
}

export default App;
